"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',49,0,12,'','',1,15325,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*',''),(4,42,'Заголовок новости 1','news-1','','<p>Компания Apple первой инициировала гонку пикселей в мобильных устройствах, представив смартфон iPhone 4. Остальным производителям понадобилось больше года, чтобы догнать, а потом и обогнать корпорацию из Купертино. Маркетинговое название Retina, изначально применявшееся только в отношении устройств Apple, прижилось в индустрии и стало использоваться повсеместно для указания на любые смартфоны с высоким показателем ppi.</p>\r\n','\r\n<p>В планшетах Retina-дисплей дебютировал менее года назад в iPad третьего поколения. Показатель ppi у этого экрана меньше, чем у iPhone (326 против 264 ppi), но для подобного рода устройств разрешение 2048×1536 точек при 9,7-дюймовом дисплее стало прорывом. Лишь в конце 2012-го у «яблочного планшета» появился конкурент с потенциально более качественным экраном.</p>\r\n<p style=\"text-align: center;\">&nbsp;<img style=\"vertical-align: middle;\" src=\"images/gall/cancel15.jpg\" width=\"200\" height=\"150\" alt=\"cancel15\" /><img style=\"margin-left: 10px; vertical-align: middle;\" src=\"images/gall/cancel10.jpg\" width=\"200\" height=\"150\" alt=\"cancel10\" /></p>\r\n<p>Планшет Google Nexus 10 получил 10-дюймовый дисплей с разрешением 2560×1600 точек и показателем плотности пикселей на дюйм 300 ppi. Лучше, чем у iPad! В сегодняшнем обзоре посмотрим, насколько хорош совместный проект Google и Samsung, а также сравним его с iPad четвертого поколения.</p>',1,0,0,8,'2012-02-15 03:52:25',42,'','2013-01-30 08:09:58',42,0,'0000-00-00 00:00:00','2012-02-15 03:52:25','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',9,0,0,'','',1,159,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(5,43,'Заголовок новости (2)','news-2','','<p>Компания Apple первой инициировала гонку пикселей в мобильных устройствах, представив смартфон iPhone 4. Остальным производителям понадобилось больше года, чтобы догнать, а потом и обогнать корпорацию из Купертино. Маркетинго