\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(12,56,'Подарки любимым','kartiny-na-zakaz','','<div class=\"quote\">\r\n<p style=\"float: left;\"><img src=\"images/phocagallery/2/thumbs/phoca_thumb_l_6.jpg\" style=\"float: left; margin-right: 10px; margin-left: 65px;\" border=\"0\" width=\"200px\" /> <img src=\"images/phocagallery/2/thumbs/phoca_thumb_l_1.jpg\" style=\"float: left; margin-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /> <img src=\"images/phocagallery/2/thumbs/phoca_thumb_l_2.jpg\" style=\"float: left;\" border=\"0\" height=\"150\" width=\"200\" /></p>\r\n<br /> <a class=\"caption\" href=\"gallery-kartiny-na-zakaz.html\">Смотреть работы</a> <!-- <div class=\"quote\">-&nbsp;<strong>акварель</strong><br />- <strong>гуашь</strong> <br />- <strong>масло</strong><br /><br />\r\n        <p>Сегодня немало белорусов желает освежить свои квартиры с помощью предметов искусства. Они ищут, где бы можно было оформить картины на заказ в Минске либо Гомеле, и приходят к нам, в художественную студию «Fresh-Design».</p>\r\n        <p style=\"font-weight: bold;\">Что мы предлагаем?</p>\r\n        <p>Во-первых, реализацию любых задумок клиента, которому нужны великолепные картины под заказ. Наши талантливые художники могут написать для вас картины маслом. Пройдёт сто лет, а они не утратят своего очарования. Мы практикуем также написание картин акварелью. Благодаря этому материалу рисунок обладает воздушностью, прозрачностью, на нём отлично играют свет и тень с чёткой прорисовкой деталей.</p>\r\n        <p style=\"font-weight: bold;\">Но это ведь дорого?</p>\r\n        <p>Стоимость каждой работы оговаривается индивидуально. Но нет причин для волнения, поскольку цена, которая будет предложена, на порядок ниже, чем в других белорусских студиях.</p>\r\n    </div> --></div>','',1,0,0,2,'2013-03-06 06:54:41',42,'','2015-12-16 13:50:35',42,0,'0000-00-00 00:00:00','2013-03-06 06:54:41','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',25,0,10,'','',1,2286,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*',''),(13,57,'Фасады и 3D рисунки','fasady-i-3d-risunki','','<div class=\"quote\"><img src=\"images/phocagallery/4/thumbs/phoca_thumb_l_1.jpg\" style=\"float: left; padding-right: 10px; margin-left: 65px;\" border=\"0\" height=\"150\" width=\"200\" /> <strong><img src=\"images/phocagallery/4/thumbs/phoca_thumb_l_4.jpg\" style=\"float: left; margin-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /></strong> <strong><img src=\"images/phocagallery/4/thumbs/phoca_thumb_l_6.jpg\" style=\"float: left;\" border=\"0\" height=\"150\" width=\"200\" /></strong>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong><a class=\"caption\" href=\"gallery-3d-risunki.html\">Смотреть работы</a></strong></p>\r\n<!-- <p>Невзрачные фасады домов оставьте в прошлом! Им на смену пришли 3d рисунки, которые способны оживить любую стену!</p>\r\n    <p style=\"font-weight: bold;\">В чём их преимущества?</p>\r\n    <p>Одно из главных преимуществ заключается в оригинальности. Очень приятно видеть, как проходящие мимо люди останавливаются и любуются красивыми картинками, расположенными на внешних стенах дома. Второе — в поднятии настроения горожанам и гостям. Качественные 3d рисунки — это новый, свежий подход в оформлении зданий.</p>\r\n    <p style=\"font-weight: bold;\">Куда обращаться?</p>\r\n    <p>В художественную студию «Fresh-Design», поскольку мы гарантируем выполнение качественных 3d рисунков. Причём предлагаем как свои варианты, так и принимаем эскизы от заказчиков. С работами можно ознакомиться не только на сайте: например, на здании областной торгово-промышленной палаты (Кирова, 44) «красуется» архитектор Станислав Шабуневский.</p>\r\n    <p></p> --></div>','',1,0,0,2,'2013-03-06 07:03:35',42,'','2015-12-16 13:52:20',42,0,'0000-00-00 00:00:00','2013-03-06 07:03:35','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',13,0,9,'','',1,2906,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*',''),(14,58,'Аэрография','aerografiya','','<div class=\"quote\">\r\n<p style=\"float: left; margin-left: 65px;\"><img src=\"images/phocagallery/5/thumbs/phoca_thumb_l_1.jpg\" style=\"float: left; margin-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /><img src=\"images/phocagallery/5/thumbs/phoca_thumb_l_2.jpg\" style=\"float: left; margin-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /> <span><img src=\"images/phocagallery/5/thumbs/\" style=\"float: left;\" border=\"0\" height=\"150\" width=\"200\" /></span></p>\r\n<p style=\"text-align: left;\"><span>&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span>&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span>&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span>&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span>&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span>&nbsp;</span></p>\r\n<p></p>\r\n<p><strong><a class=\"caption\" href=\"gallery-aerografiya.html\">Смотреть работы</a></strong></p>\r\n<!-- <p>-&nbsp;аэрография на автомобилях<br />-&nbsp;мотоциклах, скутерах&nbsp;<br />-&nbsp;мобильных телефонах, ноутбуках<br />-&nbsp;лодках, катерах<br />-&nbsp;в интерьере<br /><br /></p>\r\n    <p>Сегодня студия художественной росписи занимается аэрографией, росписью в экстерьере и интерьере, подъезде. Мы также делаем 3D-рисунки, пишем картины на заказ. С нашими работами можно ознакомиться не только на сайте, но и увидеть их на улицах Минска, Гомеля, других городов Беларуси и российского Брянска.</p>\r\n    <p style=\"font-weight: bold;\">Почему именно «Fresh Design»?</p>\r\n    <p>Причин, по которым предпочтение отдаётся именно этой студии, несколько. Основная из них — это известность на весь Минск, которую заслужили её работники благодаря своим великолепным навыкам. Для них роспись машин является удовольствием, а не работой.</p>\r\n    <p>Но аэрография в Минске в «Fresh Deasign» связана не только с «железными конями». Мы ещё разрисовываем:</p>\r\n    <ul>\r\n        <li>мотоциклы;</li>\r\n        <li>корпуса маломерных судов;</li>\r\n        <li>поверхности ноутбуков;</li>\r\n        <li>хоккейные шлемы.</li>\r\n    </ul>\r\n    <p>Наши клиенты всегда приятно удивляются трём моментам — краткосрочному исполнению, высококачественному итоговому результату и невысокой стоимости.</p>\r\n    <p><strong>Все консультации вы можете получить по телефонам: +375296-90-28-99</strong></p>\r\n    <p></p> --></div>','',1,0,0,2,'2013-03-06 07:10:21',42,'','2015-12-16 13:57:52',42,0,'0000-00-00 00:00:00','2013-03-06 07:10:21','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',14,0,8,'','Аэрография в Минске на авто, отличное качество и демократичные цены. Ваше авто будет выглядеть великолепно.',1,5984,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\\u0410\\u044d\\u0440\\u043e\\u0433\\u0440\\u0430\\u0444\\u0438\\u044f \\u0432 \\u041c\\u0438\\u043d\\u0441\\u043a\\u0435 \\u043d\\u0430 \\u0430\\u0432\\u0442\\u043e\"}',0,'*',''),(15,59,'Роспись в экстерьере','rospis-v-eksterere','','<div class=\"quote\">\r\n<p style=\"float: left; margin-left: 65px;\"><img src=\"images/phocagallery/3/thumbs/phoca_thumb_l_12.jpg\" style=\"float: left; padding-right: 10px;\" border=\"0\" width=\"200px\" /> <strong><img src=\"images/phocagallery/3/thumbs/phoca_thumb_l_9.jpg\" style=\"float: left; padding-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /></strong> <strong><img src=\"images/phocagallery/3/thumbs/phoca_thumb_l_1.jpg\" style=\"float: left;\" border=\"0\" height=\"150\" width=\"200\" /></strong></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong style=\"line-height: 1.3em;\">&nbsp;</strong></p>\r\n<p><strong style=\"line-height: 1.3em;\"><a class=\"caption\" href=\"gallery-rospis-v-eksterere.html\">Смотреть работы</a></strong></p>\r\n<!-- <p><strong style=\"line-height: 1.3em;\">Художественное оформление и граффити фасадов зданий</strong></p>\r\n    <p><span style=\"line-height: 1.3em;\">знакомо каждому по фотографиям из стран Зап</span><span style=\"line-height: 1.3em;\">адно</span><span style=\"line-height: 1.3em;\">й Европы. В Беларуссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лихвой. Мы предлагаем услуги по оформлению фасадов в первую очередь строительным и иным компаниям, готовым инвестировать в современный облик города. Таких проектов в нашей стране единицы и у Вас есть уникальная возможность стать первопроходцами, тем самым заработав положительный PR. Рисунок может служить рекламой, быть произведением искусства, нести в себе социальный призыв или меткую шутку, одно не исключает другое.</span></p>\r\n    <p><span style=\"line-height: 1.3em;\">&nbsp;</span></p>\r\n    <p><strong>Художественное оформление и граффити</strong> - это свежий (fresh) и оригинальный способ придания экстерьеру новаторских черт и современного стиля. Он характеризуется гибкостью и универсальностью применения, позволяет решать оформительские задачи различной сложности на декоративных заборах и ограждениях во дворах частных домов.</p>\r\n    <p></p>\r\n    <p><strong>Вы можете заказать художественное оформление или граффити любого вида: от шрифта до фотореалистичного изображения.</strong></p>\r\n    <p>Рисунки органично впишутся в экстерьер магазина, клуба или ресторана, обеспечат заведениям узнаваемость и оригинальный стиль. Граффити во дворе подчеркнет индивидуальность человека.</p>\r\n    <p>Помимо эстетических потребностей, граффити услуги помогут решить практические задачи: расширить пространство, скрыть огрехи архитекторов или строителей, послужат отличной альтернативой однотонной покраске стен. Граффити росписи не выцветают, а специальные краски экологически безопасны и водостойкие.</p>\r\n    <p></p>\r\n    <p><strong>Художественная реклама</strong> - новый способ заявить о себе, не прибегая к малоэффективным рекламным щитам, растяжкам и плакатам.</p>\r\n    <p>Роспиcная витрина или выставочный стенд смотрится ярче, живей и интересней традиционных, а стоимость оформления сопоставима со стоимостью качественной широкоформатной печати. Нарисовать граффити рекламу можно на любом желаемом носителе - от обычного щита до фасад здания, в любом случае, реклама ручной работы смотрится живо, привлекает внимание и впечатляет.</p> --></div>','',1,0,0,2,'2013-03-06 07:12:53',42,'','2015-12-17 07:30:30',42,0,'0000-00-00 00:00:00','2013-03-06 07:12:53','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',10,0,7,'','',1,2469,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*',''),(16,60,'Роспись в интерьере','rospis-v-interere','','<div class=\"quote\">\r\n<p style=\"float: left; margin-left: 65px;\"><span style=\"color: #3f8300;\"><img src=\"images/phocagallery/1/thumbs/phoca_thumb_l_11.jpg\" style=\"float: left; padding-right: 10px;\" border=\"0\" width=\"200px\" /> <img src=\"images/phocagallery/1/thumbs/phoca_thumb_l_12.jpg\" style=\"float: left; padding-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /><img src=\"images/phocagallery/1/thumbs/phoca_thumb_l_19.jpg\" style=\"float: left;\" border=\"0\" height=\"150\" width=\"200\" /></span></p>\r\n<p><span style=\"color: #3f8300;\">&nbsp;</span></p>\r\n<p><span style=\"color: #3f8300;\">&nbsp;</span></p>\r\n<p><span style=\"color: #3f8300;\">&nbsp;</span></p>\r\n<p><span style=\"color: #3f8300;\">&nbsp;</span></p>\r\n<p><span style=\"color: #3f8300;\">&nbsp;</span></p>\r\n<p><span style=\"color: #3f8300;\">&nbsp;</span></p>\r\n<p><a class=\"caption\" href=\"gallery-rospis-v-interere.html\" style=\"line-height: 1.3em;\">Смотреть работы</a></p>\r\n<!-- <p><span style=\"color: #494949;\">Многие из нас задумываются о том, как сделать свой дом гармоничным, по-настоящему уютным. Облик дома похож на своего хозяина. Мы часто стремимся окружить себя вещами, отражающими внутренний мир, чтобы атмосфера вокруг выражала наш дух, нашу сущность, чтобы обстановка, в которой мы живем не казалась безликой и чужой. А приходя домой, так приятно ощутить дыхание родного очага...</span></p>\r\n    <p><span style=\"color: #494949;\">Мы не просто предлагаем художественную роспись интерьера - мы продаем Вам стиль, соответствующий Вашему образу жизни и характеру.</span></p>\r\n    <ul>\r\n        <li><span style=\"color: #494949;\">классическая фреска</span></li>\r\n        <li><span style=\"color: #494949;\">аэрография</span></li>\r\n        <li><span style=\"color: #494949;\">трехмерная роспись стен(3d) с эффектом искажения пространства</span></li>\r\n        <li><span style=\"color: #494949;\">роспись стен видимыми и невидимыми светящимися красками</span></li>\r\n        <li><span style=\"color: #494949;\">орнаментальная роспись стен</span></li>\r\n        <li><span style=\"color: #494949;\">смешанная техника</span></li>\r\n    </ul>\r\n    <p><span style=\"color: #494949;\">&nbsp;</span></p>\r\n    <p><span style=\"color: #494949;\"><b>Художественная роспись стен и потолков</b></span></p>\r\n    <p><span style=\"color: #494949;\">в настоящее время набирает популярность - жилые и нежилые типовые помещения одно за другим преобразовываются в уникальные и запоминающиеся места, в которых приятно находиться. Цифровой век вернул классическому искусству былую ценность и престиж. Распространению росписи интерьера способствует создаваемый с ее помощью особенный уют, необходимый для гармонии человека. Ведь Ваше настроение и самочувствие способно изменяться от интерьера помещения, в котором Вы проводите достаточно большую часть своего времени.</span></p>\r\n    <p><span style=\"color: #494949;\">Fresh-Design объединяет профессиональных художников, работающих в разных техниках и стилях. Заказ росписи стен и потолков, в зависимости от его специфики, передается конкретному художнику или их группе, что способствует наилучшему качеству выполнения работы. Таким образом, комбинируя состав и численность творческих групп, мы в силах выполнить практически любые виды оформления, а так же масштабные проекты.</span></p>\r\n    <p><span style=\"color: #494949;\"><b>&nbsp;</b></span></p>\r\n    <p><span style=\"color: #494949;\"><b>Декор интерьера росписью стен</b></span></p>\r\n    <p><span style=\"color: #494949;\">позволяет с легкостью оперировать пространственными объемами: создавать визуальную иллюзию увеличения или уменьшения пространства. Разнообразные техники и материалы разрешают передать сложные эффекты, а использование фактуры и текстуры в росписи позволяют добиться реализма в передачи сложных сюжетов. Гарантия успешной работы - тонкое соответствие художественной росписи интерьеру, его задачам и духу.</span></p>\r\n    <p><span style=\"color: #494949;\">&nbsp;</span></p>\r\n    <p><span style=\"color: #494949;\">Особого внимания заслуживает <b>роспись стен в детских комнатах</b>.</span></p>\r\n    <p><span style=\"color: #494949;\">Детская комната - это отдельная вселенная Вашего ребенка, в которой ему должно быть комфортно. Тематика росписи абсолютно безгранична – это может быть архитектура причудливых замков со сказочными героями, природа или фантастические миры. Определение темы зависит от возраста ребенка, его характера, интересов и пристрастий. Художники Fresh-Design помогут Вам выбрать подходящий образ, разработают эскиз и выполнят роспись детской.<b>&nbsp;</b></span></p>\r\n    <p><span style=\"color: #494949;\"><b>&nbsp;</b></span></p>\r\n    <p><span style=\"color: #494949;\"><b>Художественная роспись потолков</b></span></p>\r\n    <p><span style=\"color: #494949;\">имеет свою специфику из-за сложности работ и различных нюансов. К примеру, потолок освещен намного меньше, чем стены, поэтому на потолке роспись, как правило, должна быть в более светлых тонах, чтобы темная масса не давила. По той же причине не рекомендуются яркие цвета красок. Таким образом, необходимо помнить - далеко не все изображения подойдут для потолочной росписи.</span></p>\r\n    <p><span style=\"color: #494949;\">&nbsp;</span></p>\r\n    <p><span style=\"color: #494949;\"><b>Fresh-Design предоставляет особую услугу по росписи стен</b> – классическая фреска. </span></p>\r\n    <p><span style=\"color: #494949;\">&nbsp;</span></p>\r\n    <p><span style=\"color: #494949;\">Классическая фреска представляет собой в наибольшей степени изящный и аристократичный вид настенной живописи. Сложный технологический процесс требует наивысшего мастерства. С помощью фресок интерьер помещения преображается, а визуальный эффект объема создаёт особое настроение пространства. Например, моделирование античного рельефа при создании фресок вызовет неотразимое обаяние внутреннего убранства помещения, отразит вкус и статус хозяина в обществе. Наши дизайнеры помогут Вам определиться в огромном разнообразии художественных стилистик и выберут с учетом Ваших предпочтений, целевого назначения помещения и его освещения максимально подходящие цветовые решения, технику исполнения, фактуру покрытий, тематику. Заказав у нас художественную роспись стен, потолков, фасадов или мебели, Вы станете владельцем уникального произведения искусства в Вашем доме, которое останется на века.</span></p>\r\n    <p><span style=\"color: #494949;\">&nbsp;</span></p>\r\n    <p><span style=\"color: #494949;\"><b>Мы не просто предлагаем художественную роспись интерьера - мы продаем Вам стиль, соответствующий Вашему образу жизни и характеру.</b></span></p>\r\n</div> -->\r\n<p><span style=\"color: #494949;\">&nbsp;</span></p>\r\n</div>','',1,0,0,2,'2013-03-06 07:15:22',42,'','2015-12-17 07:04:04',42,0,'0000-00-00 00:00:00','2013-03-06 07:15:22','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',19,0,6,'','',1,8068,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*',''),(17,61,'Полезные ресурсы','poleznye-resursy','','<table style=\"width: 100%;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n<tbody>\r\n<tr style=\"text-align: center;\">\r\n<td style=\"padding: 5px;\" width=\"10%\"><a href=\"http://www.medialine.by\" target=\"_blank\"><img src=\"images/poleznoe/medialine.jpg\" /></a></td>\r\n<td style=\"padding: 5px; text-align: left;\"><strong>Веб-студия «Медиа Лайн»</strong> - это команда профессионалов в области Интернет-проектов, успешно осуществляющая свою деятельность во всех областях Республики Беларусь (Минск, Гомель, Брест и др). Разработка сайтов и создание сайтов «под ключ», Интернет-магазинов, продвижение и техническая поддержка, разработка логотипа.</td>\r\n</tr>\r\n<tr style=\"text-align: center;\">\r\n<td style=\"padding: 5px;\"><a href=\"http://www.interioronline.ru\" target=\"_blank\"><img src=\"images/poleznoe/interioronline.jpg\" /></a></td>\r\n<td style=\"padding: 5px; text-align: left;\"><strong>«Интерьер онлайн»</strong> предлагает Вам воспользоваться удобным встроенным инструментом для проектирования. Здесь Вы найдете готовые решения в области обустройства вашего дома, а также полезные советы и рекомендации для того, чтобы Ваши квартира, коттедж, загородный дом стали еще более комфортными и красивыми.</td>\r\n</tr>\r\n</tbody>\r\n</table>','',0,0,0,2,'2013-06-07 10:55:33',42,'','0000-00-00 00:00:00',0,42,'2014-04-21 16:50:16','2013-06-07 10:55:33','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,5,'','',1,26,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(18,62,'Декоративная штукатурка рельефное пано','dekorativnaya-shtukaturka-rel-efnoe-pano','','<div class=\"quote\">\r\n<p><img src=\"images/phocagallery/6/thumbs/phoca_thumb_l_3.jpg\" border=\"0\" width=\"200\" height=\"150\" style=\"float: left; margin-left: 65px; margin-right: 10px;\" /> <img src=\"images/phocagallery/6/thumbs/phoca_thumb_l_16.jpg\" border=\"0\" width=\"200\" height=\"150\" style=\"float: left; margin-right: 10px;\" /><img src=\"images/phocagallery/6/thumbs/phoca_thumb_l_18.jpg\" border=\"0\" width=\"200\" height=\"150\" style=\"float: left;\" /></p>\r\n<p><span style=\"line-height: 1.3em;\"> </span></p>\r\n<p><span style=\"line-height: 1.3em;\"> </span></p>\r\n<p><span style=\"line-height: 1.3em;\"> </span></p>\r\n<p><span style=\"line-height: 1.3em;\"> </span></p>\r\n<p><span style=\"line-height: 1.3em;\"> </span></p>\r\n<p><span style=\"line-height: 1.3em;\"> </span></p>\r\n<p><span style=\"line-height: 1.3em;\"> </span></p>\r\n<p><span style=\"line-height: 1.3em;\"><a class=\"caption\" href=\"gallery-dekorativnaya-shtukaturka-relefnoe-pano.html\">Смотреть работы</a></span></p>\r\n<p>Хотите видеть вместо обычных серых стен произведения искусства? Можно закупить и развесить картины, но лучше, если будет использована декоративная штукатурка. При этом нет необходимости обязательно создавать разные фактуры, потому что наши мастера для вас сделают настоящие шедевры, применив рельефное панно. Оно в любом помещении смотрится замечательно.<p>\r\n<p style=\"font-weight: bold;\">Чем оно привлекательно?<p>\r\n<p>Если предстоит отделка с использованием штукатурки для декора и привлечением к работе художественной студии, то заказчик должен знать преимущества декоративной штукатурки стен, в частности, панно с элементами рельефности. А они следующие:<p>\r\n<ul><li>не будет стыков;</li>\r\n<li>нет сложностей с монтажом;</li>\r\n<li>устойчивость к износу;</li>\r\n<li>можно монтировать на поверхности сферического плана;</li>\r\n<li>мы изготавливаем панно с использованием индивидуальных размеров.</li></ul>\r\n<p style=\"font-weight: bold;\">А барельефы?<p>\r\n<p>Над ними тоже работает художественная студия «Fresh Design».<p>\r\n</div>','',0,0,0,2,'2013-07-11 13:45:03',42,'','2015-05-11 08:08:38',42,0,'0000-00-00 00:00:00','2013-07-11 13:45:03','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":