зволяет обеспечить идеальное хромирование бронзового, золотого, хромового, красного или любых других цветов. Эксклюзивный спрей можно наносить на самые разные </span><strong>виды поверхностей</strong><span>, такие как дерево, </span><strong>металл, гипс, пластик, керамику, полистирол, цемент и др.</strong></p>\r\n<p> </p>\r\n</div>','',0,0,0,2,'2014-03-07 08:37:28',42,'','2014-07-31 13:00:38',42,0,'0000-00-00 00:00:00','2014-03-07 08:37:28','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',11,0,3,'','',1,187,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(20,64,'Роспись в подъезде','rospis-v-pod-ezde','','<div class=\"quote\">\r\n<p style=\"float: left; margin-left: 65px;\"><img src=\"images/phocagallery/6/thumbs/phoca_thumb_l_12.jpg\" style=\"float: left; padding-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /><img src=\"images/phocagallery/6/thumbs/phoca_thumb_l_4.jpg\" style=\"float: left; padding-right: 10px;\" border=\"0\" height=\"150\" width=\"200\" /> <img src=\"images/phocagallery/6/thumbs/phoca_thumb_l_10.jpg\" style=\"float: left;\" border=\"0\" height=\"150\" width=\"200\" /></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p><span><a class=\"caption\" href=\"rospis-v-pod-ezde.html\">Смотреть работы</a></span></p>\r\n<!-- <p><span>Одно из направлений современной живописи роспись в подъездах. На </span><span>сегодняшний день обрело популярность благодаря всеобщему пониманию. Это </span><span>позволит решить сразу несколько проблем таких как грязные обшарпанные </span><span>стены, цвет который надоел и другие. Роспись на стенах в подъезде </span><span>позволит улыбнуться каждого прохожего и поднимет настроение</span></p>\r\n    <p></p> --></div>','',1,0,0,2,'2014-06-25 11:55:48',42,'','2015-12-17 07:43:37',42,42,'2015-12-17 07:43:37','2014-06-25 11:55:48','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',14,0,2,'','',1,1095,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*',''),(21,65,'Цены (2)','tseny-2','','<div class=\"quote\">\r\n<p>Стоимость работ зависит от их объема, сложности, сроков выполнения, месторасположения объекта и множества прочих факторов. Как правило, исходя из трудоемкости, оценивается стоимость работы в целом, а не стоимость ее удельной единицы (м<sup>2</sup>, кг, шт).</p>\r\n<p>Мы рекомендуем уточнять стоимость конкретной работы по телефону, так как каждый заказ имеет свои особенности.</p>\r\n<p><b>Ниже указана приблизительная стоимость:</b></p>\r\n<table style=\"border-collapse: collapse;\" cellpadding=\"4\" cellspacing=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><b>Услуга</b></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><b>Описание</b></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><b>Стоимость</b></td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">Художественная Роспись стен, аэрография в интерьере</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">&nbsp;</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">от 30 у.е. /м2 – до 150 у.е./м2</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">Художественная роспись или Граффити оформление</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">&nbsp;</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">от 20 у.е. /м2 – до 100 у.е./м2</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">Роспись или Граффити оформление в 3d</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">&nbsp;</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">от 40 у.е. /м2 – до 100 у.е./м2</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">Аэрография на ноутбуке, авто</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">&nbsp;</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">от 100 у.е..</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">Роспись по стеклу - от 50 у.е. /м2</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">&nbsp;</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">до 200 у.е./м2</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">Картины на заказ&nbsp;</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">&nbsp;</span></td>\r\n<td style=\"padding: 4px 8px; border-width: 1px; border-style: solid;\"><span style=\"color: #494949;\">Индивидуально</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><b>&nbsp;</b></p>\r\n<p><b>Наличный и безналичный расчет.</b></p>\r\n</div>','',0,0,0,2,'2012-02-14 05:30:34',42,'','2015-03-02 12:19:53',0,0,'0000-00-00 00:00:00','2012-02-14 05:30:34','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,1,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*',''),(22,66,'test','article1-2','','<p class=\"h1 title\">Свежие работы</p>\r\n<div id=\"slider-serv\">{gallery}phocagallery/gl{/gallery}</div>\r\n<p>Красота, как известно, спасёт мир. Но эту фразу, оказывается, можно применить не только к женскому очарованию. Вряд ли способны улучшить настроение унылые фасады домов, обшарпанные подъезды. Но всё способно измениться, если вы обратитесь в художественную студию в Минске «Fresh Design».</p>\r\n<p style=\"font-weight: bold;\">Что мы предлагаем?</p>\r\n<p>Наша художественная студия предоставляет широкий спектр услуг, выполняемых высококлассными мастерами. Все они имеют перед собой цель: сделать так, чтобы клиент остался довольным. Поэтому художественная роспись, выполненная ими в квартире, доме, офисе — это отличное дополнение к роскошной атмосфере в посещении.</p>\r\n<p style=\"font-weight: bold;\">А если конкретно?</p>\r\n<p>Сегодня студия художественной росписи занимается аэрографией, росписью в экстерьере и интерьере, подъезде. Мы также делаем 3D-рисунки, пишем картины на заказ. С нашими работами можно ознакомиться не только на сайте, но и увидеть их на улицах Минска, Гомеля, других городов Беларуси и российского Брянска.</p>\r\n<p class=\"h1 title\" style=\"margin-top: 15px;\"><a title=\"Перейти в группу вконтакте\" href=\"https://vk.com/freshart_design\" target=\"_blank\" style=\"text-decoration: none; color: #fff;\">Добавляйтесь в группу Вконтакте и следите за новостями!</a></p>','',-2,0,0,2,'2012-02-14 04:04:03',42,'','2015-07-07 12:02:17',42,0,'0000-00-00 00:00:00','2012-02-14 04:04:03','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,0,'','',1,8,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"browser_title\":\"\"}',0,'*','');
