INSERT INTO `j7fl4_finder_links` VALUES (6,'index.php?option=com_k2&view=item&id=5','index.php?option=com_k2&view=item&id=5:kartiny-na-zakaz&Itemid=157','Картины на заказ','акварель гуашь масло Картины на заказ. Учитывая, что картина должна приносить людям радость, в нашей галерее создана специальная творческая мастерская. Наша Fresh студия и объединяет лучших современных художников. У нас вы можете исполнить любой заказ. Вы','2013-03-05 12:02:52','ce0c0f955a5e7c081e1864ce72391a5d',1,1,1,'*','2013-02-21 01:50:07','0000-00-00 00:00:00','2013-02-21 01:58:37','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:1:\"5\";s:5:\"alias\";s:16:\"kartiny-na-zakaz\";s:7:\"summary\";s:1019:\"<div class=\"quote\">\r\n<ul>\r\n<li>акварель</li>\r\n<li>гуашь</li>\r\n<li>масло</li>\r\n</ul>\r\n<p><strong>Картины на заказ.</strong>Учитывая, что картина должна приносить людям радость, в нашей галерее создана специальная творческая мастерская. Наша Fresh студия и объединяет лучших современных художников. У нас вы можете исполнить любой заказ. Вы можете заказать картину портрет. А можете заказать картину пейзаж или натюрморт. Заказ картин вещь очень интересная и удобная. Мы быстро и качественно обеспечим изготовление любой заказанной вами картины.</p>\r\n<p><a href=\"gallery-kartiny-na-zakaz.html\">Смотреть работы</a></p>\r\n</div>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"1\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-05 10:02:52\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"0\";s:14:\"jQueryHandling\";s:9:\"1.8remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"1\";s:12:\"userFeedIcon\";s:1:\"1\";s:13:\"userItemCount\"