:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:7:\"K2 Item\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:6:\"Author\";a:1:{s:10:\"Super User\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:10:\"Super User\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:11:\"K2 Category\";a:1:{s:12:\"Услуги\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:12:\"Услуги\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:38:\"index.php?option=com_k2&view=item&id=5\";s:5:\"route\";s:66:\"index.php?option=com_k2&view=item&id=5:kartiny-na-zakaz&Itemid=157\";s:5:\"title\";s:30:\"Картины на заказ\";s:11:\"description\";s:872:\"акварель гуашь масло Картины на заказ. Учитывая, что картина должна приносить людям радость, в нашей галерее создана специальная творческая мастерская. Наша Fresh студия и объединяет лучших современных художников. У нас вы можете исполнить любой заказ. Вы можете заказать картину портрет. А можете заказать картину пейзаж или натюрморт. Заказ картин вещь очень интересная и удобная. Мы быстро и качественно обеспечим изготовление любой заказанной вами картины. Смотреть работы\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-02-21 01:50:07\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-02-21 01:58:37\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(7,'index.php?option=com_k2&view=item&id=3','index.php?option=com_k2&view=item&id=3:aerografiya&Itemid=155','Аэрография','аэрография на автомобилях мотоциклах, скутерах мобильных телефонах, ноутбуках лодках, катерах в интерьере Аэрография — это техника нанесения рисунка при помощи аэрографа на какую-либо поверхность. Чаще всего – это аэрография автомобиля, мотоцикла, сноубор','2013-03-05 12:52:47','49b30de9e2d7c5d9bd273a257c1ed1dd',1,1,1,'*','2013-02-21 01:50:07','0000-00-00 00:00:00','2013-02-21 01:58:34','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:1:\"3\";s:5:\"alias\";s:11:\"aerografiya\";s:7:\"summary\";s:2405:\"<div class=\"quote\">\r\n<ul>\r\n<li>аэрография на автомобилях</li>\r\n<li>мотоциклах, скутерах</li>\r\n<li>мобильных телефонах, ноутбуках</li>\r\n<li>лодках, катерах</li>\r\n<li>в интерьере</li>\r\n</ul>\r\n<p><strong>Аэрография</strong> — это техника нанесения рисунка при помощи аэрографа на какую-либо поверхность. Чаще всего – это аэрография автомобиля, мотоцикла, сноуборда, аэрография шлема, аэрография ноутбука или системного блока компьютера, аэрография мобильного телефона. Аэрографию сегодня многие воспринимают, как роспись автомобилей, которую, как тюнинг-услугу, продают в большинстве сервисных центров. Однако аэрография – это искусство, средство самовыражения, оригинальный способ выделиться из массы автомобилей, владельцев телефонов, велосипедов и прочих бытовых предметов, которыми заполнены наши будни.</p>\r\n<p>Аэрограф в руках талантливого художника поможет Вам раскрасить мир, подготовить оригинальный подарок, порадовать себя и близких.</p>\r\n<p>Аэрографии подвластно все: от туфель, чемоданов и компьютерных мышек, до автомобилей и офисных стен! Все фотографии, представленные на сайте <a href=\"index.php?option=com_content&amp;view=article&amp;id=1&amp;Itemid=101\">www.new.fresh-design.by</a> являются реальными работами, выполненными от эскиза до конечного рисунка художником.</p>\r\n<p><strong>Все консультации вы можете получить по телефонам: +375296-90-28-99</strong></p>\r\n<p><a href=\"gallery-aerografiya.html\">Смотреть работы</a></p>\r\n</div>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"1\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-05 10:52:43\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9