itle\";i:1;s:8:\"subtitle\";i:2;s:2:\"id\";}i:2;a:2:{i:0;s:7:\"summary\";i:1;s:4:\"body\";}i:3;a:8:{i:0;s:4:\"meta\";i:1;s:10:\"list_price\";i:2;s:10:\"sale_price\";i:3;s:7:\"metakey\";i:4;s:8:\"metadesc\";i:5;s:10:\"metaauthor\";i:6;s:6:\"author\";i:7;s:16:\"created_by_alias\";}i:4;a:2:{i:0;s:4:\"path\";i:1;s:5:\"alias\";}i:5;a:1:{i:0;s:8:\"comments\";}}s:11:\"\0*\0taxonomy\";a:4:{s:4:\"Type\";a:1:{s:7:\"K2 Item\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:7:\"K2 Item\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:6:\"Author\";a:1:{s:10:\"Super User\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:10:\"Super User\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:11:\"K2 Category\";a:1:{s:12:\"Услуги\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:12:\"Услуги\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:38:\"index.php?option=com_k2&view=item&id=1\";s:5:\"route\";s:67:\"index.php?option=com_k2&view=item&id=1:rospis-v-interere&Itemid=131\";s:5:\"title\";s:36:\"Роспись в интерьере\";s:11:\"description\";s:7565:\"Многие из нас задумываются о том, как сделать свой дом гармоничным, по-настоящему уютным. Облик дома похож на своего хозяина. Мы часто стремимся окружить себя вещами, отражающими внутренний мир, чтобы атмосфера вокруг выражала наш дух, нашу сущность, чтобы обстановка, в которой мы живем не казалась безликой и чужой. А приходя домой, так приятно ощутить дыхание родного очага... Мы не просто предлагаем художественную роспись интерьера - мы продаем Вам стиль, соответствующий Вашему образу жизни и характеру. классическая фреска аэрография трехмерная роспись стен(3d) с эффектом искажения пространства роспись стен видимыми и невидимыми светящимися красками орнаментальная роспись стен смешанная техника Художественная роспись стен и потолков в настоящее время набирает популярность - жилые и нежилые типовые помещения одно за другим преобразовываются в уникальные и запоминающиеся места, в которых приятно находиться. Цифровой век вернул классическому искусству былую ценность и престиж. Распространению росписи интерьера способствуетсоздаваемый с ее помощью особенный уют, необходимый для гармонии человека. Ведь Ваше настроение и самочувствие способно изменяться от интерьера помещения, в котором Вы проводите достаточно большую часть своего времени. Fresh-Design объединяет профессиональных художников, работающих в разных техниках и стилях. Заказ росписи стен и потолков, в зависимости от его специфики, передается конкретному художнику или их группе, что способствует наилучшему качеству выполнения работы. Таким образом, комбинируя состав и численность творческих групп, мы в силах выполнить практически любые виды оформления, а так же масштабные проекты. Декор интерьера росписью стен позволяет с легкостью оперировать пространственными объемами: создавать визуальную иллюзию увеличения или уменьшения пространства. Разнообразные техники и материалы разрешают передать сложные эффекты, а использование фактуры и текстуры в росписи позволяют добиться реализма в передачи сложных сюжетов. Гарантия успешной работы - тонкое соответствие художественной росписи интерьеру, его задачам и духу. Особого внимания заслуживаетроспись стен в детских комнатах . Детская комната - это отдельная вселенная Вашего ребенка, в которой ему должно быть комфортно. Тематика росписи абсолютно безгранична – это может быть архитектура причудливых замков со сказочными героями, природа или фантастические миры. Определение темы зависит от возраста ребенка, его характера, интересов и пристрастий. Художники Fresh-Design помогут Вам выбрать подходящий образ, разработают эскиз и выполнят роспись детской. Художественная роспись потолков имеет свою специфику из-за сложности работ и различных нюансов. К примеру, потолок освещен намного меньше, чем стены, поэтому на потолке роспись, как правило, должна быть в более светлых тонах, чтобы темная масса не давила. По той же причине не рекомендуются яркие цвета красок. Таким образом, необходимо помнить - далеко не все изображения подойдут для потолочной росписи. Fresh-Design предоставляет особую услугу по росписи стен – классическая фреска. Классическая фреска представляет собой в наибольшей степени изящный и аристократичный вид настенной живописи. Сложный технологический процесс требуетнаивысшего мастерства. С помощью фресок интерьер помещения преображается, а визуальный эффект объема создаёт особое настроение пространства. Например, моделирование античного рельефа при создании фресок вызовет неотразимое обаяние внутреннего убранства помещения, отразит вкус и статус хозяина в обществе. Наши дизайнеры помогут Вам определиться в огромном разнообразии художественных стилистик и выберут с учетом Ваших предпочтений, целевого назначения помещения и его освещения максимально подходящие цветовые решения, технику исполнения, фактуру покрытий, тематику. Заказав у нас художественную роспись стен, потолков, фасадов или мебели, Вы станете владельцем уникального произведения искусства в Вашем доме, которое останется на века. Мы не просто предлагаем художественную роспись интерьера - мы продаем Вам стиль, соответствующий Вашему образу жизни и характеру. Смотреть работы\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-02-21 01:50:07\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-02-21 01:50:07\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(9,'index.php?option=com_k2&view=item&id=2','index.php?option=com_k2&view=item&id=2:rospis-v-eksterere&Itemid=154','Роспись в экстерьере','Художественное оформление и граффити фасадов зданий знакомо каждому по фотографиям из стран Западной Европы. В Беларуссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лихвой. ','2013-03-05 13:00:50','0338c69a5c88c5d44b1a1d7a10ea9d81',1,1,1,'*','2013-02-21 01:50:07','0000-00-00 00:00:00','2013-02-21 01:58:27','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:1:\"2\";s:5:\"alias\";s:18:\"rospis-v-eksterere\";s:7:\"summary\";s:4008:\"<div class=\"quote\">\r\n<p><b>Художественное оформление и граффити фасадов зданий</b> знакомо каждому по фотографиям из стран Западной Европы. В Беларуссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лихвой. Мы предлагаем услуги по оформлению фасадов в первую очередь строительным и иным компаниям, готовым инвестировать в современный облик города. Таких проектов в нашей стране единицы и у Вас есть уникальная возможность стать первопроходцами, тем самым заработав положительный PR. Рисунок может служить рекламой, быть произведением искусства, нести в себе социальный призыв или меткую шутку, одно не исключает другое.</p>\r\n<p><b>Художественное оформление и граффити</b> - это свежий (fresh) и оригинальный способ придания экстерьеру новаторских черт и современного стиля. Он характеризуется гибкостью и универсальностью применения, позволяет решать оформительские задачи различной сложности на декоративных заборах и ограждениях во дворах частных домов.</p>\r\n<p><b>Вы можете заказать художественное оформление или граффити любого вида: от шрифта до фотореалистичного изображения.</b></p>\r\n<p>Рисунки органично впишутся в экстерьер магазина, клуба или ресторана, обеспечат заведениям узнаваемость и оригинальный стиль. Граффити во дворе подчеркнет индивидуальность человека.</p>\r\n<p>Помимо эстетических потребностей, граффити услуги помогут решить практические задачи: расширить пространство, скрыть огрехи архитекторов или строителей, послужат отличной альтернативой однотонной покраске стен. Граффити росписи не выцветают, а специальные краски экологически безопасны и водостойкие.</p>\r\n<p><b>Художественная реклама</b> - новый способ заявить о себе, не прибегая к малоэффективным рекламным щитам, растяжкам и плакатам.</p>\r\n<p>Роспиcная витрина или выставочный стенд смотрится ярче, живей и интересней традиционных, а стоимость оформления сопоставима со стоимостью качественной широкоформатной печати. Нарисовать граффити рекламу можно на любом желаемом носителе - от обычного щита до фасад здания, в любом случае, реклама ручной работы смотрится живо, привлекает внимание и впечатляет.</p>\r\n<a href=\"gallery-rospis-v-eksterere.html\">Смотреть работы</a></div>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"1\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-05 11:00:49\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"0\";s:14:\"jQueryHandling\";s:9:\"1.8remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"1\";s:12:\"userFeedIcon\";s:1:\"1\";s:13:\"userItemCount\";s:2:\"10\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:0:\"\";s:12:\"tagItemCount\";s:2:\"10\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreated\";s:1:\"1\";s:12:\"tagItemImage\";s:1:\"1\";s:16:\"tagItemIntroText\";s:1:\"1\";s:15:\"tagItemCategory\";s:1:\"1\";s:15:\"tagItemReadMore\";s:1:\"1\";s:18:\"tagItemExtra