=154\";s:5:\"title\";s:38:\"Роспись в экстерьере\";s:11:\"description\";s:3850:\"Художественное оформление и граффити фасадов зданий знакомо каждому по фотографиям из стран Западной Европы. В Беларуссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лихвой. Мы предлагаем услуги по оформлению фасадов в первую очередь строительным и иным компаниям, готовым инвестировать в современный облик города. Таких проектов в нашей стране единицы и у Вас есть уникальная возможность стать первопроходцами, тем самым заработав положительный PR. Рисунок может служить рекламой, быть произведением искусства, нести в себе социальный призыв или меткую шутку, одно не исключает другое. Художественное оформление и граффити - это свежий (fresh) и оригинальный способ придания экстерьеру новаторских черт и современного стиля. Он характеризуется гибкостью и универсальностью применения, позволяет решать оформительские задачи различной сложности на декоративных заборах и ограждениях во дворах частных домов. Вы можете заказать художественное оформление или граффити любого вида: от шрифта дофотореалистичного изображения. Рисунки органично впишутся в экстерьер магазина, клуба или ресторана, обеспечат заведениям узнаваемость и оригинальный стиль. Граффити во дворе подчеркнет индивидуальность человека. Помимо эстетических потребностей, граффити услуги помогут решить практические задачи: расширить пространство, скрыть огрехи архитекторов или строителей, послужат отличной альтернативой однотонной покраске стен. Граффити росписи не выцветают, а специальные краски экологически безопасны и водостойкие. Художественная реклама - новый способ заявить о себе, не прибегая к малоэффективным рекламным щитам, растяжкам и плакатам. Роспиcная витрина или выставочный стенд смотрится ярче, живей и интересней традиционных, а стоимость оформления сопоставима со стоимостью качественной широкоформатной печати. Нарисовать граффити рекламу можно на любом желаемом носителе - от обычного щита до фасад здания, в любом случае, реклама ручной работы смотрится живо, привлекает внимание и впечатляет. Смотреть работы\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-02-21 01:50:07\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-02-21 01:58:27\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(10,'index.php?option=com_k2&view=item&id=4','index.php?option=com_k2&view=item&id=4:3d-risunki&Itemid=156','3D рисунки','Художественное оформление и граффити фасадов зданий в 3d знакомо каждому по фотографиям из стран Западной Европы. В Белоруссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лих','2013-03-05 12:58:00','aeabeeb77d4beb282f8deba508b360c9',1,1,1,'*','2013-02-21 01:50:07','0000-00-00 00:00:00','2013-02-21 01:58:34','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:1:\"4\";s:5:\"alias\";s:10:\"3d-risunki\";s:7:\"summary\";s:2584:\"<div class=\"quote\">\r\n<p><b>Художественное оформление и граффити фасадов зданий в 3d</b> знакомо каждому по фотографиям из стран Западной Европы. В Белоруссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лихвой. Мы предлагаем услуги по оформлению фасадов в первую очередь строительным и иным компаниям, готовым инвестировать в современный облик города. Таких проектов в нашей стране единицы и у Вас есть уникальная возможность стать первопроходцами, тем самым заработав положительный PR. Рисунок может служить рекламой, быть произведением искусства, нести в себе социальный призыв или меткую шутку, одно не исключает другое.</p>\r\n<p>Малые формы 3d рисунков на асфальте и тротуарной плитке только входят в экстерьер наших городов. Мы предлагаем разместить картины и персонажи на прилегающей к вам территории.</p>\r\n<p>Рисунки органично впишутся в экстерьер магазина, клуба или ресторана, обеспечат заведениям узнаваемость и оригинальный стиль. 3d рисунок во дворе подчеркнёт индивидуальность человека.</p>\r\n<p>Помимо эстетических потребностей, 3d рисунки помогут решить практические задачи: расширить пространство, скрыть огрехи архитекторов или строителей, послужат отличной альтернативой однотонной покраске стен. Граффити росписи не выцветают, а специальные краски экологически безопасны и водостойкие.</p>\r\n<p><a href=\"gallery-3d-risunki.html\">Смотреть работы</a></p>\r\n</div>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"1\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-05 10:58:00\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"0\";s:14:\"jQueryHandling\";s:9:\"1.8remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"1\";s:12:\"userFeedIcon\";s:1:\"1\";s:13:\"userItemCount\";s:2:\"10\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:0:\"\";s:12:\"tagItemCount\";s:2:\"10\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreated\";s:1:\"1\";s:12:\"tagItemImage\";s:1:\"1\";s:16:\"tagItemIntroText\";s:1:\"1\";s:15:\"tagItemCategory\";s:1:\"1\";s:15:\"tagItemReadMore\";s:1:\"1