:\"title\";s:17:\"3D рисунки\";s:11:\"description\";s:2470:\"Художественное оформление и граффити фасадов зданий в 3d знакомо каждому по фотографиям из стран Западной Европы. В Белоруссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лихвой. Мы предлагаем услуги по оформлению фасадов в первую очередь строительным и иным компаниям, готовым инвестировать в современный облик города. Таких проектов в нашей стране единицы и у Вас есть уникальная возможность стать первопроходцами, тем самым заработав положительный PR. Рисунок может служить рекламой, быть произведением искусства, нести в себе социальный призыв или меткую шутку, одно не исключает другое. Малые формы 3d рисунков на асфальте и тротуарной плитке только входят в экстерьер наших городов. Мы предлагаем разместить картины и персонажи на прилегающей к вам территории. Рисунки органично впишутся в экстерьер магазина, клуба или ресторана, обеспечат заведениям узнаваемость и оригинальный стиль. 3d рисунок во дворе подчеркнёт индивидуальность человека. Помимо эстетических потребностей, 3d рисунки помогутрешить практические задачи: расширить пространство, скрыть огрехи архитекторов или строителей, послужат отличной альтернативой однотонной покраске стен. Граффити росписи не выцветают, а специальные краски экологически безопасны и водостойкие. Смотреть работы\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-02-21 01:50:07\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-02-21 01:58:34\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}');
