INSERT INTO `j7fl4_k2_items` VALUES (1,'Роспись в интерьере','rospis-v-interere',1,1,'<div class=\"quote\">\r\n<p>Многие из нас задумываются о том, как сделать свой дом гармоничным, по-настоящему уютным. Облик дома похож на своего хозяина. Мы часто стремимся окружить себя вещами, отражающими внутренний мир, чтобы атмосфера вокруг выражала наш дух, нашу сущность, чтобы обстановка, в которой мы живем не казалась безликой и чужой. А приходя домой, так приятно ощутить дыхание родного очага...</p>\r\n<p>Мы не просто предлагаем художественную роспись интерьера - мы продаем Вам стиль, соответствующий Вашему образу жизни и характеру.</p>\r\n<ul>\r\n<li>классическая фреска</li>\r\n<li>аэрография</li>\r\n<li>трехмерная роспись стен(3d) с эффектом искажения пространства</li>\r\n<li>роспись стен видимыми и невидимыми светящимися красками</li>\r\n<li>орнаментальная роспись стен</li>\r\n<li>смешанная техника</li>\r\n</ul>\r\n<p><b>Художественная роспись стен и потолков</b> в настоящее время набирает популярность - жилые и нежилые типовые помещения одно за другим преобразовываются в уникальные и запоминающиеся места, в которых приятно находиться. Цифровой век вернул классическому искусству былую ценность и престиж. Распространению росписи интерьера способствует создаваемый с ее помощью особенный уют, необходимый для гармонии человека. Ведь Ваше настроение и самочувствие способно изменяться от интерьера помещения, в котором Вы проводите достаточно большую часть своего времени.</p>\r\n<p>Fresh-Design объединяет профессиональных художников, работающих в разных техниках и стилях. Заказ росписи стен и потолков, в зависимости от его специфики, передается конкретному художнику или их группе, что способствует наилучшему качеству выполнения работы. Таким образом, комбинируя состав и численность творческих групп, мы в силах выполнить практически любые виды оформления, а так же масштабные проекты.</p>\r\n<p><b>Декор интерьера росписью стен</b> позволяет с легкостью оперировать пространственными объемами: создавать визуальную иллюзию увеличения или уменьшения пространства. Разнообразные техники и материалы разрешают передать сложные эффекты, а использование фактуры и текстуры в росписи позволяют добиться реализма в передачи сложных сюжетов. Гарантия успешной работы - тонкое соответствие художественной росписи интерьеру, его задачам и духу.</p>\r\n<p>Особого внимания заслуживает <b>роспись стен в детских комнатах</b>. Детская комната - это отдельная вселенная Вашего ребенка, в которой ему должно быть комфортно. Тематика росписи абсолютно безгранична – это может быть архитектура причудливых замков со сказочными героями, природа или фантастические миры. Определение темы зависит от возраста ребенка, его характера, интересов и пристрастий. Художники Fresh-Design помогут Вам выбрать подходящий образ, разработают эскиз и выполнят роспись детской.</p>\r\n<p><b>Художественная роспись потолков</b> имеет свою специфику из-за сложности работ и различных нюансов. К примеру, потолок освещен намного меньше, чем стены, поэтому на потолке роспись, как правило, должна быть в более светлых тонах, чтобы темная масса не давила. По той же причине не рекомендуются яркие цвета красок. Таким образом, необходимо помнить - далеко не все изображения подойдут для потолочной росписи.</p>\r\n<p><b>Fresh-Design предоставляет особую услугу по росписи стен</b> – классическая фреска. Классическая фреска представляет собой в наибольшей степени изящный и аристократичный вид настенной живописи. Сложный технологический процесс требует наивысшего мастерства. С помощью фресок интерьер помещения преображается, а визуальный эффект объема создаёт особое настроение пространства. Например, моделирование античного рельефа при создании фресок вызовет неотразимое обаяние внутреннего убранства помещения, отразит вкус и статус хозяина в обществе. Наши дизайнеры помогут Вам определиться в огромном разнообразии художественных стилистик и выберут с учетом Ваших предпочтений, целевого назначения помещения и его освещения максимально подходящие цветовые решения, технику исполнения, фактуру покрытий, тематику. Заказав у нас художественную роспись стен, потолков, фасадов или мебели, Вы станете владельцем уникального произведения искусства в Вашем доме, которое останется на века.</p>\r\n<p><b>Мы не просто предлагаем художественную роспись интерьера - мы продаем Вам стиль, соответствующий Вашему образу жизни и характеру.</b></p>\r\n<p><a href=\"gallery-rospis-v-interere.html\">Смотреть работы</a></p>\r\n</div>','',NULL,'','[]','','2013-02-21 01:50:07',42,'',0,'0000-00-00 00:00:00','2013-03-05 10:55:58',42,'2013-02-21 01:50:07','0000-00-00 00:00:00',1,1,1,0,0,'','','','',149,'{\"catItemTitle\":\"\",\"catItemTitleLinked\":\"\",\"catItemFeaturedNotice\":\"\",\"catItemAuthor\":\"\",\"catItemDateCreated\":\"\",\"catItemRating\":\"\",\"catItemImage\":\"\",\"catItemIntroText\":\"\",\"catItemExtraFields\":\"\",\"catItemHits\":\"\",\"catItemCategory\":\"\",\"catItemTags\":\"\",\"catItemAttachments\":\"\",\"catItemAttachmentsCounter\":\"\",\"catItemVideo\":\"\",\"catItemVideoWidth\":\"\",\"catItemVideoHeight\":\"\",\"catItemAudioWidth\":\"\",\"catItemAudioHeight\":\"\",\"catItemVideoAutoPlay\":\"\",\"catItemImageGallery\":\"\",\"catItemDateModified\":\"\",\"catItemReadMore\":\"\",\"catItemCommentsAnchor\":\"\",\"catItemK2Plugins\":\"\",\"itemDateCreated\":\"\",\"itemTitle\":\"\",\"itemFeaturedNotice\":\"\",\"itemAuthor\":\"\",\"itemFontResizer\":\"\",\"itemPrintButton\":\"\",\"itemEmailButton\":\"\",\"itemSocialButton\":\"\",\"itemVideoAnchor\":\"\",\"itemImageGalleryAnchor\":\"\",\"itemCommentsAnchor\":\"\",\"itemRating\":\"\",\"itemImage\":\"\",\"itemImgSize\":\"\",\"itemImageMainCaption\":\"\",\"itemImageMainCredits\":\"\",\"itemIntroText\":\"\",\"itemFullText\":\"\",\"itemExtraFields\":\"\",\"itemDateModified\":\"\",\"itemHits\":\"\",\"itemCategory\":\"\",\"itemTags\":\"\",\"itemAttachments\":\"\",\"itemAttachmentsCounter\":\"\",\"itemVideo\":\"\",\"itemVideoWidth\":\"\",\"itemVideoHeight\":\"\",\"itemAudioWidth\":\"\",\"itemAudioHeight\":\"\",\"itemVideoAutoPlay\":\"\",\"itemVideoCaption\":\"\",\"itemVideoCredits\":\"\",\"itemImageGallery\":\"\",\"itemNavigation\":\"\",\"itemComments\":\"\",\"itemTwitterButton\":\"\",\"itemFacebookButton\":\"\",\"itemGooglePlusOneButton\":\"\",\"itemAuthorBlock\":\"\",\"itemAuthorImage\":\"\",\"itemAuthorDescription\":\"\",\"itemAuthorURL\":\"\",\"itemAuthorEmail\":\"\",\"itemAuthorLatest\":\"\",\"itemAuthorLatestLimit\":\"\",\"itemRelated\":\"\",\"itemRelatedLimit\":\"\",\"itemRelatedTitle\":\"\",\"itemRelatedCategory\":\"\",\"itemRelatedImageSize\":\"\",\"itemRelatedIntrotext\":\"\",\"itemRelatedFulltext\":\"\",\"itemRelatedAuthor\":\"\",\"itemRelatedMedia\":\"\",\"itemRelatedImageGallery\":\"\",\"itemK2Plugins\":\"\"}','','robots=\nauthor=','','','*'),(2,'Роспись в экстерьере','rospis-v-eksterere',1,1,'<div class=\"quote\">\r\n<p><b>Художественное оформление и граффити фасадов зданий</b> знакомо каждому по фотографиям из стран Западной Европы. В Беларуссии и России расписные здания все еще остаются редкостью, в то время, как серых \"коробок\", способных послужить холстом хватает с лихвой. Мы предлагаем услуги по оформлению фасадов в первую очередь строительным и иным компаниям, готовым инвестировать в современный облик города. Таких проектов в нашей стране единицы и у Вас есть уникальная возможность стать первопроходцами, тем самым заработав положительный PR. Рисунок может служить рекламой, быть произведением искусства, нести в себе социальный призыв или меткую шутку, одно не исключает другое.</p>\r\n<p><b>Художественное оформление и граффити</b> - это свежий (fresh) и оригинальный способ придания экстерьеру новаторских черт и современного стиля. Он характеризуется гибкостью и универсальностью применения, позволяет решать оформительские задачи различной сложности на декоративных заборах и ограждениях во дворах частных домов.</p>\r\n<p><b>Вы можете заказать художественное оформление или граффити любого вида: от шрифта до фотореалистичного изображения.</b></p>\r\n<p>Рисунки органично впишутся в экстерьер магазина, клуба или ресторана, обеспечат заведениям узнаваемость и оригинальный стиль. Граффити во дворе подчеркнет индивидуальность человека.</p>\r\n<p>Помимо эстетических потребностей, граффити услуги помогут решить практические задачи: расширить пространство, скрыть огрехи архитекторов или строителей, послужат отличной альтернативой однотонной покраске стен. Граффити росписи не выцветают, а специальные краски экологически безопасны и водостойкие.</p>\r\n<p><b>Художественная реклама</b> - новый способ заявить о себе, не прибегая к малоэффективным рекламным щитам, растяжкам и плакатам.</p>\r\n<p>Роспиcная витрина или выставочный стенд смотрится ярче, живей и интересней традиционных, а стоимость оформления сопоставима со стоимостью качественной широкоформатной печати. Нарисовать граффити рекламу можно на любом желаемом носителе - от обычного щита до фасад здания, в любом случае, реклама ручной работы смотрится живо, привлекает внимание и впечатляет.</p>\r\n<a href=\"gallery-rospis-v-eksterere.html\">Смотреть работы</a></div>','',NULL,'','[]','','2013-02-21 01:58:27',42,'',0,'0000-00-00 00:00:00','2013-03-05 11:00:49',42,'2013-02-21 01:50:07','0000-00-00 00:00:00',1,1,2,0,0,'','','','',66,'{\"catItemTitle\":\"\",\"catItemTitleLinked\":\"\",\"catItemFeaturedNotice\":\"\",\"catItemAuthor\":\"\",\"catItemDateCreated\":\"\",\"catItemRating\":\"\",\"catItemImage\":\"\",\"catItemIntroText\":\"\",\"catItemExtraFields\":\"\",\"catItemHits\":\"\",\"catItemCategory\":\"\",\"catItemTags\":\"\",\"catItemAttachments\":\"\",\"catItemAttachmentsCounter\":\"\",\"catItemVideo\":\"\",\"catItemVideoWidth\":\"\",\"catItemVideoHeight\":\"\",\"catItemAudioWidth\":\"\",\"catItemAudioHeight\":\"\",\"catItemVideoAutoPlay\":\"\",\"catItemImageGallery\":\"\",\"catItemDateModified\":\"\",\"catItemReadMore\":\"\",\"catItemCommentsAnchor\":\"\",\"catItemK2Plugins\":\"\",\"itemDateCreated\":\"\",\"itemTitle\":\"\",\"itemFeaturedNotice\":\"\",\"itemAuthor\":\"\",\"itemFontResizer\":\"\",\"itemPrintButton\":\"\",\"itemEmailButton\":\"\",\"itemSocialButton\":\"\",\"itemVideoAnchor\":\"\",\"itemImageGalleryAnchor\":\"\",\"itemCommentsAnchor\":\"\",\"itemRating\":\"\",\"itemImage\":\"\",\"itemImgSize\":\"\",\"itemImageMainCaption\":\"\",\"itemImageMainCredits\":\"\",\"itemIntroText\":\"\",\"itemFullText\":\"\",\"itemExtraFields\":\"\",\"itemDateModified\":\"\",\"itemHits\":\"\",\"itemCategory\":\"\",\"itemTags\":\"\",\"itemAttachments\":\"\",\"itemAttachmentsCounter\":\"\",\"itemVideo\":\"\",\"itemVideoWidth\":\"\",\"itemVideoHeight\":\"\",\"itemAudioWidth\":\"\",\"itemAudioHeight\":\"\",\"itemVideoAutoPlay\":\"\",\"itemVideoCaption\":\"\",\"itemVideoCredits\":\"\",\"itemImageGallery\":\"\",\"itemNavigation\":\"\",\"itemComments\":\"\",\"itemTwitterButton\":\"\",\"itemFacebookButton\":\"\",\"itemGooglePlusOneButton\":\"\",\"itemAuthorBlock\":\"\",\"itemAuthorImage\":\"\",\"itemAuthorDescription\":\"\",\"itemAuthorURL\":\"\",\"itemAuthorEmail\":\"\",\"itemAuthorLatest\":\"\",\"itemAuthorLatestLimit\":\"\",\"itemRelated\":\"\",\"itemRelatedLimit\":\"\",\"itemRelatedTitle\":\"\",\"itemRelatedCategory\":\"\",\"itemRelatedImageSize\":\"\",\"itemRelatedIntrotext\":\"\",\"itemRelatedFulltext\":\"\",\"itemRelatedAuthor\":\"\",\"itemRelatedMedia\":\"\",\"itemRelatedImageGallery\":\"\",\"itemK2Plugins\":\"\"}','','robots=\nauthor=','','','*'),(3,'Аэрография','aerografiya',1,1,'<div class=\"quote\">\r\n<ul>\r\n<li>аэрография на автомобилях</li>\r\n<li>мотоциклах, скутерах</li>\r\n<li>мобильных телефонах, ноутбуках</li>\r\n<li>лодках, катерах</li>\r\n<li>в интерьере</li>\r\n</ul>\r\n<p><strong>Аэрография</strong> — это техника нанесения рисунка при помощи аэрографа на какую-либо поверхность. Чаще всего – это аэрография автомобиля, мотоцикла, сноуборда, аэрография шлема, аэрография ноутбука или системного блока компьютера, аэрография мобильного телефона. Аэрографию сегодня многие воспринимают, как роспись автомобилей, которую, как тюнинг-услугу, продают в большинстве сервисных центров. Однако аэрография – это искусство, средство самовыражения, оригинальный способ выделиться из массы автомобилей, владельцев телефонов, велосипедов и прочих бытовых предметов, которыми заполнены наши будни.</p>\r\n<p>Аэрограф в руках талантливого художника поможет Вам раскрасить мир, подготовить оригинальный подарок, порадовать себя и близких.</p>\r\n<p>Аэрографии подвластно все: от туфель, чемоданов и компьютерных мышек, до автомобилей и офисных стен! Все фотографии, представленные на сайте <a href=\"index.php?option=com_content&amp;view=article&amp;id=1&amp;Itemid=101\">www.new.fresh-design.by</a> являются реальными работами, выполненными от эскиза до конечного рисунка художником.</p>\r\n<p><strong>Все консультации вы можете получить по телефонам: +375296-90-28-99</strong></p>\r\n<p><a href=\"gallery-aerografiya.html\">Смотреть работы</a></p>\r\n</div>','',NULL,'','[]','','2013-02-21 01:58:34',42,'',0,'0000-00-00 00:00:00','2013-03-05 10:52:43',42,'2013-02-21 01:50:07','0000-00-00 00:00:00',1,1,3,0,0,'','','','',40,'{\"catItemTitle\":\"\",\"catItemTitleLinked\":\"\",\"catItemFeaturedNotice\":\"\",\"catItemAuthor\":\"\",\"catItemDateCreated\":\"\",\"catItemRating\":\"\",\"catItemImage\":\"\",\"catItemIntroText\":\"\",\"catItemExtraFields\":\"\",\"catItemHits\":\"\",\"catItemCategory\":\"\",\"catItemTags\":\"\",\"catItemAttachments\":\"\",\"catItemAttachmentsCounter\":\"\",\"catItemVideo\":\"\",\"catItemVideoWidth\":\"\",\"catItemVideoHeight\":\"\",\"catItemAudioWidth\":\"\",\"catItemAudioHeight\":\"\",\"catItemVideoAutoPlay\":\"\",\"catItemImageGallery\":\"\",\"catItemDateModified\":\"\",\"catItemReadMore\":\"\",\"catItemCommentsAnchor\":\"\",\"catItemK2Plugins\":\"\",\"itemDateCreated\":\"\",\"itemTitle\":\"\",\"itemFeaturedNotice\":\"\",\"itemAuthor\":\"\",\"itemFontResizer\":\"\",\"itemPrintButton\":\"\",\"itemEmailButton\":\"\",\"itemSocialButton\":\"