меткую шутку, одно не исключает другое.</p>\r\n<p>Малые формы 3d рисунков на асфальте и тротуарной плитке только входят в экстерьер наших городов. Мы предлагаем разместить картины и персонажи на прилегающей к вам территории.</p>\r\n<p>Рисунки органично впишутся в экстерьер магазина, клуба или ресторана, обеспечат заведениям узнаваемость и оригинальный стиль. 3d рисунок во дворе подчеркнёт индивидуальность человека.</p>\r\n<p>Помимо эстетических потребностей, 3d рисунки помогут решить практические задачи: расширить пространство, скрыть огрехи архитекторов или строителей, послужат отличной альтернативой однотонной покраске стен. Граффити росписи не выцветают, а специальные краски экологически безопасны и водостойкие.</p>\r\n<p><a href=\"gallery-3d-risunki.html\">Смотреть работы</a></p>\r\n</div>','',NULL,'','[]','','2013-02-21 01:58:34',42,'',0,'0000-00-00 00:00:00','2013-03-05 10:58:00',42,'2013-02-21 01:50:07','0000-00-00 00:00:00',1,1,4,0,0,'','','','',32,'{\"catItemTitle\":\"\",\"catItemTitleLinked\":\"\",\"catItemFeaturedNotice\":\"\",\"catItemAuthor\":\"\",\"catItemDateCreated\":\"\",\"catItemRating\":\"\",\"catItemImage\":\"\",\"catItemIntroText\":\"\",\"catItemExtraFields\":\"\",\"catItemHits\":\"\",\"catItemCategory\":\"\",\"catItemTags\":\"\",\"catItemAttachments\":\"\",\"catItemAttachmentsCounter\":\"\",\"catItemVideo\":\"\",\"catItemVideoWidth\":\"\",\"catItemVideoHeight\":\"\",\"catItemAudioWidth\":\"\",\"catItemAudioHeight\":\"\",\"catItemVideoAutoPlay\":\"\",\"catItemImageGallery\":\"\",\"catItemDateModified\":\"\",\"catItemReadMore\":\"\",\"catItemCommentsAnchor\":\"\",\"catItemK2Plugins\":\"\",\"itemDateCreated\":\"\",\"itemTitle\":\"\",\"itemFeaturedNotice\":\"\",\"itemAuthor\":\"\",\"itemFontResizer\":\"\",\"itemPrintButton\":\"\",\"itemEmailButton\":\"\",\"itemSocialButton\":\"\",\"itemVideoAnchor\":\"\",\"itemImageGalleryAnchor\":\"\",\"itemCommentsAnchor\":\"\",\"itemRating\":\"\",\"itemImage\":\"\",\"itemImgSize\":\"\",\"itemImageMainCaption\":\